Don Depresso, Volume II
Comics About a Depressed Guy
by Ruji Chapnik

(Multimedia E-Book - EPUB3 Version)

HOT NEW LEAK!!11!1!

Don Depresso is a depressed freelance writer who does a lot of drugs and pines for his ex-girlfriend. This book contains a collection of all the Don Depresso comic strips created from October of 2012 through March of 2013, along with commentary.

The Don Depresso comics series deals with depression as well as other recurring themes, such as drug use and abuse, technology (particularly Linux and open source software), dating and relationships, and what it's like to be an American in the 21st century.

